export const initialState = {
	ans: [],
	url: {
		screenshotUrl: "",
		thumbUrl: "",
	},
	isDirect: true,
};

export const ADD_ANSWER = "ADD_ANSWER";
export const ADD_URL = "ADD_URL";
export const CONFIRM_INDIRECT = "CONFIRM_INDIRECT";

const reducer = (state = initialState, action) => {
	switch (action.type) {
		case ADD_ANSWER: {
			return {
				...state,
				ans: action.data,
			};
		}
		case ADD_URL: {
			return {
				...state,
				url: action.data,
			};
		}
		case CONFIRM_INDIRECT: {
			return {
				...state,
				isDirect: action.data,
			};
		}
		default: {
			return {
				...state,
			};
		}
	}
};

export default reducer;
